Little wave, big impact.
My camera got hit by the lip and ripped out of my hands this session and was no where to be seen. I started scratching to the inside with hopes of finding it before it got washed up on the rocks. Thankfully everyone in the lineup started shouting and pointing, turns out the housing had finally surfaced from under the water right behind me. For anyone who was thinking of asking: Yes, my camera water housing floats. 
