I shot these photos the day after my mom died. I was on such an emotional rollercoaster and so sleep-deprived, but with an incoming swell the following day, I had to go chase a feeling of normality. I’d been feeling so sad for so long, it felt like an eternity. But immersing myself in the ocean again, surrounded by friends and powerful waves, brought me an extremely overwhelming sense of happiness. After linking-up with my good friend Michael early in the session, he hugged me while I spontaneously burst into tears and cried in his arms. In that moment of vulnerability he said something I will never forget: “You’re exactly where you’re supposed to be.” 

The ocean heals.

